import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import { Navigation, Autoplay } from "swiper/modules";
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/autoplay";
import "./Banner.css"
const Banner = () => {
  return (
    <div className="banner">
      <Swiper
        modules={[Navigation, Autoplay]}
        navigation
        autoplay={{ delay: 3000 }}
        loop={true}
        className="banner-swiper"
      >
        <SwiperSlide>
          <img src="img/banner/sale1.png"  className="slide-image" />
        </SwiperSlide>
        <SwiperSlide>
          <img src="img/banner/new.png" className="slide-image" />

        </SwiperSlide>
        <SwiperSlide>
           <img src="img/banner/sale.png" className="slide-image" />
        </SwiperSlide>
      </Swiper>
    </div>
  );
};

export default Banner;
